import React, { Fragment } from 'react'
import Button from '../../common/button'
import Input from '../../common/input'

export default class EditTagEmployee extends React.Component{
    constructor(props){
        super(props);
        this.state={

        }
    }
    
    onCancelClick = () => {
       // this.props.data.callback('xin chào');
        this.props.onCancelClick();
    }

    componentDidMount() {
        console.log(this.props.data.empData)
    }

    render(){
        return(
          <Fragment>
                <div style={styles.TitleModal} >
                    Thay đổi thông tin sử dụng thẻ của nhân viên
                </div>
                <div>
                    <div style={styles.InputModal}>
                        <Input 
                        title={'Tên nhân viên'}
                        disabled
                        readonly ={true}
                        value={this.props.data.empData.name}
                        />
                    </div>
                    <Input
                    title={'ID nhân sự'}
                    disabled
                    readonly ={true}
                    value= {this.props.data.empData.eCode}
                    />
                    <Input
                    title={'Email'}
                    value= {this.props.data.empData.email}
                    />
                    <Input
                    title={'Mã thẻ từ cũ'}
                    disabled
                    readonly ={true}
                    value= {this.props.data.empData.rCode}
                    />
                    <Input
                    title ={'Mã thẻ từ mới'}
                    />
                </div>
                <div style={styles.GroupButton}>
                    
                    <Button onClick={this.onCancelClick}
                    title={'Hủy'}/>
                    <Button 
                    title={'Đồng ý'}/>
                </div>
              
          </Fragment>
        )
    }
}

const styles = {
    InputModal: {
        padding: '20px',
    },

    TitleModal: {
        fontSize: '21px',
        fontWeight: 600,
        color: 'rgb(227, 6, 19)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        height: '30px',
        paddingTop: '25px',
        paddingBottom: '15px',
        textAlign: 'center'
    },

    GroupButton: {
        marginTop: '50px',
        height: '70px',
        borderTop: '1px solid red',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    }

}
